16&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;path_model&lt;/td&gt;\n  &lt;td&gt;bestRF&lt;em&gt;SQN&lt;/em&gt;ahead&lt;em&gt;8&lt;/em&gt;m_16.joblib&lt;/td&gt;\n&lt;/tr&gt;\n&lt;tr&gt;\n  &lt;td&gt;m&lt;/td&gt;\n  &lt;td&gt;16&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;Source Code:&lt;/p&gt;\n\n&lt;pre&gt;&lt;code&gt;class MyStrategy(bt.Strategy):\n    params = (('path_model', 'bestRF_SQN_ahead_8_m_16.joblib'),\n              ('m', 16),\n              ('stoptype', bt.Order.StopTrail),\n              ('trailpercent',0.000))  # price is 2% less than the entry point\n\n\n    def __init__(self):                  \n        '''\n        Nuvos indicadores\n        -Una EMA de 8 periodos y una de 14 periodos (https://www.backtrader.com/blog/posts/2018-01-27-recursive-indicators/recursive-indicator/)\n        -Un RSI de 7 periodos con nivel de sobrecopra de 70 y de sobreventa de 30.\n        '''\n#         self.lines.rsi = RSI(self.data, period=7)\n#         self.lines.ema = EMA(self.data, period=8)\n#         self.lines.ema = EMA(self.data, period=14)\n        bt.indicators.SMA(period=8)\n        bt.indicators.SMA(period=14)\n        bt.indicators.RSI(period=7, subplot=True)\n\n#         bt.indicators.RSI(self.datas[0], period=7, plotname='RSI_7')\n#         bt.indicators.ExponentialMovingAverage(self.datas[0], period=8, plotname='EMA_8')\n#         bt.indicators.ExponentialMovingAverage(self.datas[0], period=14, plotname='EMA_14')\n\n        self.lines.rf = MyRFIndicator(self.data, path_model=self.p.path_model, m=self.p.m)\n\n        self.ahead_time = 8\n        self.timeIni = None \n#         self.order = None\n\n    def notify_order(self, order):\n        ''' \u00bfPor qu\u00e9 usar notify_order?\n        Porque esto asegura que la orden que debe ser controlada por el Stop realmente se ha ejecutado. Esto puede no ser un gran problema \n        durante las pruebas de backtesting, pero lo es cuando se opera en vivo.   \n        ''' \n        if not order.status == order.Completed:\n            return  # discard any other notification\n\n        if not self.position:  # we left the market\n            print('SELL@price: {:.2f}'.format(order.executed.price))\n            return\n\n        # We have entered the market\n        print('BUY @price: {:.2f}'.format(order.executed.price))\n\n\n\n    def next(self):       \n        if not self.position:  # not in the market\n            self.timeIni = len(self.data)\n\n            if self.lines.rf[0] == 1:                 \n                size = int(self.broker.get_cash() / self.data)\n                self.buy(size=size)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n            # print('COMPRO!')                \n            elif self.lines.rf[0] == 0:\n                size = int(self.broker.get_cash() / self.data)\n                self.sell(size=size)\n#                 self.sell(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n                # Stop trail       \n#                 self.buy(size=size, exectype=self.p.stoptype, trailpercent=self.p.trailpercent)\n\n#                 print('VENDO!')                        \n        elif self.position:  # in the market\n            if len(self.data) &amp;gt; self.timeIni + self.ahead_time:\n                self.close()  # close long position\n\n&lt;/code&gt;&lt;/pre&gt;\n\n&lt;hr /&gt;\n\n&lt;h1&gt;Data Feeds&lt;/h1&gt;\n\n&lt;h2&gt;PandasData&lt;/h2&gt;\n\n&lt;table class=\"metaDataTable\"&gt;\n&lt;thead&gt;\n&lt;tr&gt;\n  &lt;th&gt;Property&lt;/th&gt;\n  &lt;th&gt;Value&lt;/th&gt;\n&lt;/tr&gt;\n&lt;/thead&gt;\n&lt;tbody&gt;\n&lt;tr&gt;\n  &lt;td&gt;DataName:&lt;/td&gt;\n  &lt;td&gt;Open     High      Low    Close  Adj CLose  Volume&lt;/td&gt;\n&lt;/tr&gt;\n&lt;/tbody&gt;\n&lt;/table&gt;\n\n&lt;p&gt;D
